import React from 'react';

const Background = () => (
  <div className="container">
    <h2>Education</h2>
    <div className="list-group">
      <div className="list-group-item">
        <div className="row">
          <div className="col-12">
            <h3>Bachelors in Software Engineering</h3>
          </div>
          <div className="col-12">
            <span>Air University</span>
          </div>
          <div className="col-12">
            <span>Islamabad</span>
          </div>
          <div className="col-12">
            <p>09/2021 – present | Pakistan</p>
          </div>
        </div>
      </div>
      {/* ... similar structure for FSc Pre Engineering */}
    </div>
    <h2>Certificates</h2>
    <ul className="list-group">
      <li className="list-group-item">Operating System Foundations Certificate</li>
      <li className="list-group-item">WordPress Certificate</li>
      <li className="list-group-item">SharePoint and Power Virtual Agent to Create Smart Chatbot Certificate</li>
    </ul>
  </div>
);

export default Background;
